static uint32_t pseudorandom();
static uint8_t rss(uint16_t angle, uint8_t config);

void simulation_send_calibration_packets(doa_t* doa)
{
    for(uint16_t angle = 0; angle < DOA_MESSERED_ANGLE_NUM; angle++)
    {
        for(uint8_t config = 0; config < ANTENNA_CONFIGS_NUM; config++)
            doa_receive_RSS(doa, rss(angle, config));
    }
}

uint16_t simulation_send_measurement_packets(doa_t* doa)
{
    uint16_t emitter_angle = pseudorandom() % DOA_MESSERED_ANGLE_NUM;

    for(uint8_t config = 0; config < ANTENNA_CONFIGS_NUM; config++)
    {
        for(uint8_t i = 0; i < DOA_SAMPLES_NUM; i++)
            doa_receive_RSS(doa, rss(emitter_angle, config));
    }
    return emitter_angle;
}

// very simple pseudorandom number generator. https://eprint.iacr.org/2011/007.pdf
static uint32_t pseudorandom()
{ 
    static uint32_t x=123456789,y=234567891,z=345678912,w=456789123,c=0; 
    uint32_t t; 

    y ^= (y<<5); y ^= (y>>7); y ^= (y<<22); 
    t = z+w+c; z = w; c = t < 0; w = t&2147483647; 
    x += 1411392427; 

    return x + y + w; 
}
// Friis transmission equation with rss value normalized to fit in 8 bits
#define EMITTED_POWER                        0.1f 
#define EMITTER_GAIN                         1
#define WAVE_LENGTH_SQUARE                   0.0146f // ((3 * 10^8) / (2.48 * 10^9))^2
#define EMITTER_DISTANCE_TIMES_4PI_SQUARE    1421 // (3*4*PI)^2;  distance == 3;
#define NORMALIZATION_FACTOR                 30000000 // rss value has to fit in 8 bits
#define RSS_FACTOR    EMITTED_POWER * EMITTER_GAIN * WAVE_LENGTH_SQUARE * NORMALIZATION_FACTOR \
                / EMITTER_DISTANCE_TIMES_4PI_SQUARE

static uint8_t rss(uint16_t angle, uint8_t config)
{
    float rss = RSS_FACTOR * simulation_gain[config][angle];
    return (uint8_t)rss;
}
